#include <stdio.h> #include <stdlib.h> #include <unistd.h> #include <signal.h> #include <sys/wait.h> // SIGCHLD signal handler function void sigchld_handler(int signum) { // Use waitpid non-blocking to reclaim all terminated child processes while (waitpid(-1, NULL, WNOHANG) > 0); } int main() { // Set up SIGCHLD signal handler struct sigaction sa; sa.sa_handler = sigchld_handler; sigemptyset(&sa.sa_mask); sa.sa_flags = SA_RESTART; // Automatically restart interrupted system calls if (sigaction(SIGCHLD, &sa, NULL) == -1) { perror("sigaction"); exit(EXIT_FAILURE); } // Create child process pid_t pid = fork(); if (pid < 0) { perror("fork"); exit(EXIT_FAILURE); } if (pid == 0) { // Child process printf("Child process: PID = %d
", getpid()); sleep(10); // Simulate child process executing some tasks printf("Child process ending: PID = %d
", getpid()); exit(EXIT_SUCCESS); } else { // Parent process printf("Parent process: PID = %d, Child process PID = %d
", getpid(), pid); // Parent process continues to execute other tasks for (int i = 0; i < 5; ++i) { printf("Parent process is working...
"); sleep(10000); } // Cleanup work before parent process ends printf("Parent process ending: PID = %d
", getpid()); } return 0; }
